func strToSlice(isbn string) (result []int, err error) {

	for pos, char := range isbn {
		if unicode.IsLetter(char) && (char != 'X' || pos != 9) {
			err = errors.New("invalid character")
			return
		} else if char == 'X' {
			result = append(result, 10)
