			return err
		}
		it.isNew = true
	}

	for name, text := range it.Files {
		file := filepath.Join(it.Path(), name)

		err := os.MkdirAll(filepath.Dir(file), 0755)
		if err != nil {
			return err
		}

		if _, err := os.Stat(file); err != nil {
			if !os.IsNotExist(err) {
				return err
			}

			if !it.isNew {
				it.isUpdated = true
			}

			err = ioutil.WriteFile(file, []byte(text), 0644)
			if err != nil {
				return err
			}
		}
	}
	return nil
