	if !i.Spec.EnableIpWhiteListing {
		return nil, 200
	}

	remoteIP := net.ParseIP(requestIP(r))

	for _, ip := range i.Spec.AllowedIPs {
		allowedIP, allowedNet, err := net.ParseCIDR(ip)
