func TestUUIDCollisions(t *testing.T) {
	var mutex sync.Mutex
	var waitGroup sync.WaitGroup
	uuidMap := make(map[string]bool)

	createUUID := func() {
		mutex.Lock()
		defer mutex.Unlock()
		uuidMap[syncbase.UUID()] = true
