func utf8To16LE(p []byte) []byte {
	bs := make([]byte, 0, 2*len(p))
	pos := 0
	for pos < len(p) {
		bytes, size := consumeNextRune(p[pos:])
		pos += size
		bs = append(bs, bytes...)
	}
	return bs
}



func consumeNextRune(p []byte) ([]byte, int)

output:
{
	r, size := utf8.DecodeRune(p)
	if r <= 0xffff {
