func (w *writeTo) Write(p []byte) (n int, err error) {
	if len(p)+w.position > w.buffer.Size() {
		return 0, errors.New("Overflow")
	}
	if err := w.buffer.MoveAt(p, w.position); err != nil {
		return 0, errors.Wrap(err, "Memcopy")
	}
	w.position += len(p)
	return len(p), nil
