func Unique(data sort.Interface) int

output:
{
	if !sort.IsSorted(data) {
		panic(fmt.Errorf("util: the input to Unique() must be sorted"))
	}

	if data.Len() == 0 {
		return 0
	}
	length := data.Len()
	j := 0
	for i := 1; i < length; i++ {
		if data.Less(i-1, i) {
			data.Swap(i-1, j)
			j++
		}
	}
	data.Swap(length-1, j)
