		SQL:   sql,
		Args:  args,
	}
}

func (c *ContextHook) End(ctx context.Context, result sql.Result, err error) {
	c.Ctx = ctx
	c.Result = result
	c.Err = err
	c.ExecuteTime = time.Now().Sub(c.start)
}

