  puzzleSlice, err := convertToSlice(s.puzzle, s.blockXDim, s.blockYDim, s.delimiter)
  if err != nil {
     return "", err
  }

  solvedPuzzle, success := sudokuDlx.Solve(puzzleSlice, s.blockXDim, s.blockYDim)
  if success {
    solution := convertToString(solvedPuzzle, s.delimiter)
    return solution, nil
  }


