        k := strings.ToUpper(spl[0])
        v := strings.Trim(spl[1], "\"")
        if k == "NAME" {
            osr.Name = v
        } else if k == "PRETTY_NAME" {
            osr.PrettyName = v
        } else if k == "VERSION" {
