		if strings.Contains(value, "%(") {
			value = interpolater.ReplaceAllStringFunc(value, func(m string) string {
				match := interpolater.FindAllStringSubmatch(m, 1)[0][1]
				replacement := options.Get(match)
				return replacement
			})
		}
	}
	return value
}


