func (p *parser) lookupRdir() (*spec.Rdir, bool) {
	if p.kind() != token.WORD {
		return nil, false
	}

	for _, r := range p.spec.Rdir {
		if p.matchRdir(r) {
			return r, true
		}
	}
	return nil, false
}

func (p *parser) parseRdirExpr(s *spec.Rdir) ast.Expr {
	if false ||
		p.kind() != token.WORD ||
		!p.matchRdir(s) {
		p.errorExpected(strconv.Quote(s.ID))
		return p.badVoid()
	}
	var r = &ast.RdirExpr{}

	r.ID, r.IDPos = p.lit(), p.next()

	if s.Paren && !s.NoParen && p.kind() != token.LPAREN {
		p.errorExpected("parenthesis")
	}
	if !s.Paren && p.kind() == token.LPAREN {
		p.error("unexpected parenthesis")
	}
	if p.kind() == token.LPAREN {
		r.Paren = p.parseParenArg(spec.PrExpr)
	}

	if !p.expect(token.COMMA) {
		return p.badEnd(r.IDPos)
	}
	r.Comma = p.next()

	r.X = p.parseWord()

	return r
}

func (p *parser) matchRdir(s *spec.Rdir) bool

output:
