func (q *Queue) String() string {
	node := q.head

	var values []string

	if node == nil {
		return "[]"
	}

	for node.next != nil {
		values = append(values, fmt.Sprintf("%v", node.value))

		node = node.next
	}
	values = append(values, fmt.Sprintf("%v", node.value))

	return fmt.Sprintf("[%s]", strings.Join(values, ", "))
}



func (q *Queue) Dequeue() (value interface{}, ok bool) {

	if q.head == nil {
		return 0, false
	} else {
		node := q.head
		q.head = node.next
		return node.value, true
	}
}

