func (o *OutputController) run() error {
	fmt.Println("Output Pipeline started")
	for {
		select {
		case <-o.t.Dying():
			return nil
		default:
		}

		currentBatch := 0
		batch := make([]*event.Event, o.batchSize)
		stopping := false

	CURRENT:
		for currentBatch < o.batchSize {
			select {
			case event := <-o.in:
				batch[currentBatch] = event
				currentBatch++
			case <-o.t.Dying():
				stopping = true
				break CURRENT
			}
		}

		fmt.Println("Processing batch")
		o.start.Run(batch)

		if stopping {
			return nil
		}
	}
}


