		if mv, ok := m[v]; ok {
			r[i] = mv
		} else {
			r[i] = v
		}
		lv := int32(l - 1 + min)
		if v != lv {
			if mv, ok := m[lv]; ok {
				m[v] = mv
			} else {
				m[v] = lv
			}
		}
		l--
