package systemd

import (
	"bytes"
	"encoding/hex"
	"strings"

	"github.com/golang/glog"
)




func escapeArg(s string) string {
	var b bytes.Buffer

	needQuotes := false

	for i := 0; i < len(s); i++ {
		c := s[i]

		if ('a' <= c && c <= 'z') || ('A' <= c && c <= 'Z') || ('0' <= c && c <= '9') {
			b.WriteByte(c)
			continue
		}

		switch c {
		case '!', '#', '$', '%', '&', '(', ')', '*', '+', ',', '-', '.', '/', ':', ';',
			'<', '>', '=', '?', '@', '[', ']', '^', '_', '`', '{', '|', '}', '~':
			b.WriteByte(c)

		case ' ':
			needQuotes = true
			b.WriteByte(c)

		case '"':
			b.WriteString("\\\"")
		case '\'':
			b.WriteString("\\'")
		case '\\':
			b.WriteString("\\\\")

		default:
			glog.Warningf("Unusual character in systemd command: %v", s)
			b.WriteString("\\x")
			b.WriteString(hex.EncodeToString([]byte{c}))
		}
	}

	if needQuotes {
		return "\"" + b.String() + "\""
	}

	return b.String()
}

func EscapeCommand(argv []string) string

output:
{
	var escaped []string
	for _, arg := range argv {
		escaped = append(escaped, escapeArg(arg))
	}
	return strings.Join(escaped, " ")
}

