	contextDataObject["path_parts"] = segmentedPathArray

	contextDataObject["path"] = copiedRequest.URL.Path

	contextDataObject["remote_addr"] = copiedRequest.RemoteAddr

	contextDataObject["request_id"] = uuid.NewV4().String()

