			timer:  strategy.NewTimer(now),
			remain: n,
		}
	})
}

type countLimitTimer struct {
	timer  Timer
	remain int
}

func (t *countLimitTimer) NextSleep(now time.Time) (time.Duration, bool) {
	if t.remain--; t.remain <= 0 {
		return 0, false
	}
