	timer Timer
	end   time.Time
}

func (t *timeLimitTimer) NextSleep(now time.Time) (time.Duration, bool) {
	sleep, ok := t.timer.NextSleep(now)
	if ok && now.Add(sleep).After(t.end) {
		return 0, false
	}
	return sleep, ok
}

