		return
	}
	data, err := ReadToDelim(r, []byte(commandDelim))
	if err != nil {
		s.logFunc(err)
		WriteError(w, err)
	}
	data = strings.TrimSuffix(data, commandDelim)
	if len(data) > valueLimit {
		WriteError(w, ExceededValueLengthLimit(len(data)))
