	p.node[i].heapIndex = i
	p.node[j].heapIndex = j
}



func (p *PriorityQueue) Pop() interface{} {
	p.pos--
	item := p.node[p.pos]
	delete(p.node, p.pos)
	return item
}

func (p *PriorityQueue) PushNode(n *Node) {
	heap.Push(p, n)
}

func (p *PriorityQueue) PopNode() *Node {
	return heap.Pop(p).(*Node)
