func (t Track) TransferTo(dir string) error {
	dst := assemblePath(dir, t)
	if err := os.MkdirAll(filepath.Dir(dst), 0777); err != nil {
		log.Fatal("can't create " + filepath.Dir(dst) + "dir")
		return err
