func assemblePath(dir string, t Track) string {
	return fmt.Sprintf("%s/%s/%s/%02d-%s%s", dir, t.Artist, t.Album, t.Number, t.Title, t.Ext)
}

func copy(src, dst string) error {
	s, err := os.Open(src)
	if err != nil {
		return err
	}

	defer s.Close()
	d, err := os.Create(dst)
	if err != nil {
		return err
	}
	if _, err := io.Copy(d, s); err != nil {
		d.Close()
		return err
	}
	return d.Close()
}

