func (c *ModelBuilderContext) AddTask(task Task) {
	key := buildTaskKey(task)

	existing, found := c.Tasks[key]
	if found {
		glog.Fatalf("found duplicate tasks with name %q: %v and %v", key, task, existing)
	}
	c.Tasks[key] = task
